            <h1>Comprovante de Agendamento</h1>
            <div class="data">
                <p><strong>Nome do Aluno:</strong> <?= htmlspecialchars($nomeAluno) ?></p>
                <p><strong>Profissional:</strong> <?= htmlspecialchars($profissional) ?></p>
                <p><strong>Posição na Fila:</strong> <?= htmlspecialchars($posicao) ?></p>
                <p><strong>Data da Solicitação:</strong> <?= htmlspecialchars($dataSolicitacao) ?></p>
            </div>
            <button onclick="gerarPDF()">Gerar PDF</button>
        </div>
    </main>
    <script>
        async function gerarPDF() {
            const { jsPDF } = window.jspdf;

            // Criar o PDF
            const pdf = new jsPDF();

            pdf.setFont('helvetica', 'bold');
            pdf.setFontSize(16);
            pdf.text('Comprovante de Agendamento', 105, 20, { align: 'center' });

            pdf.setFont('helvetica', 'normal');
            pdf.setFontSize(12);

            pdf.text(`Nome do Aluno: <?= addslashes($nomeAluno) ?>`, 20, 40);
            pdf.text(`Profissional: <?= addslashes($profissional) ?>`, 20, 50);
            pdf.text(`Posição na Fila: <?= addslashes($posicao) ?>`, 20, 60);
            pdf.text(`Data da Solicitação: <?= addslashes($dataSolicitacao) ?>`, 20, 70);


            const imgData = 'data:image/jpeg;base64,'; // Substitua pelo seu base64 da imagem
            pdf.addImage(imgData, 'PNG', 85, 275, 40, 10); // Ajuste as coordenadas e o tamanho conforme necessário

            // Rodapé
            pdf.setFontSize(10);
            pdf.text(' Secretaria de Educação Nossa Senhora do Socorro', 105, 290, { align: 'center' });

            // Baixar o PDF
            pdf.save(`comprovante <?= addslashes($nomeAluno) ?>.pdf`);
        }
    </script>
